import {Card,Table,Button} from 'antd';
import button from '../../components/link-button/button';
export default class User extends  Component {
  state={
    columns:[]
  };
  initColumns(){
    this.setState({
      columns:[]
    })
  }
  componentWillMount() {
   this.initColumns();
  }
  render() {
    const title=(
        <Button type={'primary'}>
          创建用户
        </Button>
    );
    const {columns}=this.state;
    return (
        <Card title={title}>
          <Table
              bordered={true}
              columns={columns}
          />
        </Card>
    );
  }
}
